  05> WILLIAMS, Garth Gaster m on 22.09.1919 to (1)KIDD, Kathleen Marion
  b 15.03.1894 d 26.04.1972
  b ** ** 1896 d 20.09.1920
  Garth b. at Putiki, Wanganui. Garth attended Wanganui Collegiate School then worked on "Puketiti" station
  on the East Coast for Mr A B Williams and on "Kiwitea" in the Rangitikei area for Mr Jacobs. He went
  overseas in ww1 (1917-18) and after the Armistice he served for a further six months in the Army of
  Occupation on the Rhine.
  After the war he owned a dairy farm but lost it during the Depression. He volunteered again for service in
  WW2 and became a Sergeant in the Waiouru Military Camp. In his later years he became a nurseryman and
  raised seedlings for years at his home at 6 Williams Terrace, Palmerston North.
  01> WILLIAMS, Myra Colgate (Winks) m on 18.10.1945 to DRUMMOND, Dan Francis
  b 10.09.1920
  b 24.02.1923
  Dan, s/o Harry Bennett Drummond and Dorothy Elizabeth Hine. Address: Mount Herbert Home, Mount Herbert
  Road, Waipukurau.
  Winks was educated at Miss Fraser's Preparatory School, Palmerston North, Aokautere and Tiritea Primary
  Schools and Palmerston North Girls' High School. In 1938 she took up work in wool research, working for
  three years with Mr R Waters, a lecturer at Massey Agricultural College. She then worked at the
  Palmerston North Post Office until her marriage.
